import json
from PyQt6.QtWebEngineWidgets import QWebEngineView

class LeafletMapCanvas(QWebEngineView):
    def __init__(self, parent=None):
        super().__init__(parent)
        self.flight_data = None
        self.current_frame = 0
        
        # Standard Light Map Template
        self.html_template = """
        <!DOCTYPE html>
        <html>
        <head>
            <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css" />
            <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>
            <script src="https://unpkg.com/leaflet-rotatedmarker@0.2.0/leaflet.rotatedMarker.js"></script>
            <style> 
                body, html, #map { margin: 0; padding: 0; height: 100%; width: 100%; } 
            </style>
        </head>
        <body>
            <div id="map"></div>
            <script>
                // Initialize Map
                var map = L.map('map').setView([0, 0], 2);
                
                // Use Standard OpenStreetMap Tiles (Light/Colorful)
                L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
                    maxZoom: 19,
                    attribution: 'Â© OpenStreetMap'
                }).addTo(map);

                var planeIcon = L.icon({
                    iconUrl: 'data:image/png;base64,',
                    iconSize: [32, 32],   // Size of the icon in pixels
                    iconAnchor: [16, 16], // Point of the icon which will correspond to marker's location
                });

                // Blue Flight Path (Standard)
                var flightPath = L.polyline([], {
                    color: 'blue', 
                    weight: 2
                }).addTo(map);

                var planeMarker = L.marker([0, 0], { 
                    icon: planeIcon,
                    rotationAngle: 0,      // Initial angle
                    rotationOrigin: 'center center' 
                }).addTo(map);

                function loadPath(latlngs) {
                    flightPath.setLatLngs(latlngs);
                    if (latlngs.length > 0) { map.fitBounds(flightPath.getBounds()); }
                }

                function updatePosition(lat, lon, angle) {
                    var newLatLng = [lat, lon];
                    planeMarker.setLatLng(newLatLng);
                    planeMarker.setRotationAngle(angle);
                }
            </script>
        </body>
        </html>
        """
        self.setHtml(self.html_template)
        
    def load_flight_data(self, lats, lons, angs):
        self.flight_data = {'lat': lats, 'lon': lons, 'ang': angs}
        self.current_frame = 0
        
        step = max(1, len(lats) // 2000) 
        path_points = [[float(lats[i]), float(lons[i])] for i in range(0, len(lats), step)]
        
        self.page().runJavaScript(f"loadPath({json.dumps(path_points)});")

    def update_marker(self, idx):
        if not self.flight_data: return
        lats, lons, angs = self.flight_data['lat'], self.flight_data['lon'], self.flight_data['ang']
        if idx >= len(lats): idx = len(lats) - 1
        
        lat, lon, ang = float(lats[idx]), float(lons[idx]), float(angs[idx])
        self.page().runJavaScript(f"updatePosition({lat}, {lon}, {ang});")